import React from "react";
import { useLocation } from "react-router-dom";

const FinalPage = () => {
  const location = useLocation();
  const { section1Value, section2Value, section3Value } = location.state;

  return (
    <div>
      <h1>Final Page</h1>
      <p>Section 1: {section1Value}</p>
      <p>Section 2: {section2Value}</p>
      <p>Section 3: {section3Value}</p>
    </div>
  );
};

export default FinalPage;
